import React, { Component } from 'react';
import './App.css';
import {Route} from 'react-router-dom'
import Data from './data/Data'
import MainSidebar from './main/MainSidebar'
import MainMain from './main/MainMain'
import FolderSidebar from './folder/FolderSidebar'
import FolderMain from './folder/FolderMain'
class App extends Component {
  constructor(props){
    super(props)
    this.state={
      folders:Data.folders,
      note:Data.notes
    }

  }
  render() {
    return (
      <div className="App">
        <header>
          <h1>Noteful</h1>
        </header>
        <sidbar>
        <Route exact path='/folder' component={MainSidebar} />

        </sidbar>
        <main>
          <Route path='/' component={MainMain}/>
          <Route path='/folder' component={FolderMain}/>
        </main>
      </div>
    );
  }
}

export default App;
